import React from "react";
import "./Services.scss";
import Main from "../../Main";
import Faq from 'react-faq-component';

const Services = () => {

    const data = {
        title: "FAQ's",
        rows: [
          {
            title: "Is Microsuction Safe?",
            content: "Lorem ipsum dolor sit amet, consectetur "
          },
          {
            title: "Nunc maximus, magna at ultricies elementum",
            content: "Nunc maximus, magna at ultricies elementum, risus turpis vulputate quam."
          },
          {
            title: "Curabitur laoreet, mauris vel blandit fringilla",
            content: "Curabitur laoreet, mauris vel blandit fringilla, leo elit rhoncus nunc"
          },
          {
            title: "What is the package version",
            content: "v1.0.5"
          }]
      }

  return (
    <Main pageTitle={"Services"} pageClass={"services"}>
      <div className="container">
        <h1>Services</h1>
        <h2>What is Microsuction?</h2>
        <p>
          Microsuction ear wax removal is a technique employing gentle suction
          to eliminate excessive or bothersome ear wax. Our skilled Audiologists
          utilize a microscope to directly inspect the ear canal, employing a
          sterile suction device to delicately extract the wax. Our professional
          staff are are all equipped with the latest state-of-the-art
          technology, ensuring a thorough and reassuring experience from the
          comfort of your own home.
        </p>
        <p>What to expect from our ear wax removal appointment</p>
        <ol>
            <li>Medical History: the audiologist will take history related to your ears.</li>
            <li>Examination: Your ears will be assessed and images will be recorded using a HD otoscope, you will also be able to view these images live.</li>
            <li>Explanation of procedure: Our Audiologists will explain the process of cleaning your ears.</li>
            <li>Procedure: the removal procedure will be performed by the Audiologist.</li>
            <li>Review: Once complete further imaging will be done on your ears to see the outcome of your procedure.</li>
        </ol>
      </div>
    </Main>
  );
};

export default Services;
